import React, { useEffect, useState } from 'react'
import Axios from 'axios'
import { Tabs } from './ficha/Tabs'

export const Ficha = (props) => {
    const {rut, paciente} = props
    const [datosFicha, setDatosFicha] = useState("")
    const [carga, setcarga] = useState(0)
    useEffect(() => {
        Axios.get(`https://api-rest-cfedent.herokuapp.com/fichas/${rut}`).then( (response) =>{
            if(response.status === 200){
                setDatosFicha(response.data[0])
                setcarga(carga+1)
            }   
        })
    }, [carga])
    return (
        <div className="container mt-3">
            {datosFicha === undefined?
            <div className="row" >
                <div class="alert alert-warning alert-dismissible fade show" role="alert">
                    Este <strong>Usuario</strong> no posee ficha
                    <button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button>
                </div>
                <div className="col">
                    <Tabs rut={rut} paciente={paciente} carga={carga} setcarga={setcarga}/>
               </div>
            </div>

            :
            "existe"
            }
        </div>
    )
}
